    false,nt"url": null,nt"notes": "This Bird Conservation Plan was developed
    by the U.S. Geological Survey, Upper Midwest Environmental Sciences Center in cooperation
    with Partners in Flight. The goals of the Bird Conservation Plan are to: 1) identify
    species and habitats most in need of conservation, 2) establish objectives for bird
    populations and habitats in physiographic areas (ecoregions) and states, 3) identify
    the general habitat requirements of priority species at the site level, 4) identify
    the quantity and quality of habitat required by birds at the landscape scale, and
    5) recommend needed conservation actions and suggest opportunities to accomplish
